/*
 * alive 값이 true이면 각 스레드는 무한 루프를 돌며 반복해서 일을 하고,
 * alive 값이 false가 되면 무한 루프를 빠져나와 스레드를 자연스럽게 종료한다.
 */
bool alive = true;
 // 크리티컬 섹션 진입을 위한 뮤텍스 (크리티컬 섹션에 진입을 제한하고 공유 자원의 보호를 위해 사용)
pthread_mutex_t mutex = PTHREAD_MUTEX_INITIALIZER;
// writer 스레드 관련 뮤텍스
pthread_mutex_t writer_mutex = PTHREAD_MUTEX_INITIALIZER;
// reader 스레드 관련 뮤텍스
pthread_mutex_t reader_mutex = PTHREAD_MUTEX_INITIALIZER;
// 큐 뮤텍스 (스레드의 실행 순서와 우선순위를 제어하기 위해 사용)
pthread_mutex_t queue_mutex = PTHREAD_MUTEX_INITIALIZER;

int active_readers = 0; // 활성화된 reader 스레드 수
int active_writers = 0; // 활성화된 writer 스레드 수



/*
 * Reader 스레드는 같은 문자를 L0번 출력한다. 예를 들면 <AAA...AA> 이런 식이다.
 * 출력할 문자는 인자를 통해 0이면 A, 1이면 B, ..., 등으로 출력하며, 시작과 끝을 <...>로 나타낸다.
 * 단일 reader라면 <AAA...AA>처럼 같은 문자만 출력하겠지만, critical section에서 reader의
 * 중복을 허용하기 때문에 reader가 많아지면 출력이 어지럽게 섞여서 나오는 것이 정상이다.
 */
void *reader(void *arg)
{
    int id, i;

        
    /*
     * 들어온 인자를 통해 출력할 문자의 종류를 정한다.
     */
    id = *(int *)arg;
    /*
     * 스레드가 살아 있는 동안 같은 문자열 시퀀스 <XXX...XX>를 반복해서 출력한다.
     */
    while (alive) {
        // queue 뮤텍스를 먼저 락을 걸고, reader 뮤텍스를 락을 걸어 크리티컬 섹션에 진입할 때 
        // 다른 Reader 스레드가 크리티컬 섹션에 동시에 진입하지 못하도록 함
        pthread_mutex_lock(&queue_mutex);
        pthread_mutex_lock(&reader_mutex);
        // active_readers를 증가시키고, 첫 번째 Reader 스레드가 크리티컬 섹션에 진입하는 경우 
        active_readers++;
        if(active_readers == 1)
        // mutex 뮤텍스를 락을 걸어 Writer 스레드나 다른 Reader 스레드가 크리티컬 섹션에 진입하지 못하도록 함
            pthread_mutex_lock(&mutex);
        // reader 와 queue 뮤텍스의 락을 푸고 크리티컬 섹션에 진입
        pthread_mutex_unlock(&reader_mutex);
        pthread_mutex_unlock(&queue_mutex);
        
        /*
         * Begin Critical Section
         */
        
        printf("<");
        for (i = 0; i < L0; ++i)
            printf("%c", 'A'+id);
        printf(">");
        /*
         * End Critical Section
         */
        // 크리티컬 섹션을 나와서 reader 뮤텍스를 락을 걸고, active_readers 값을 감소
        pthread_mutex_lock(&reader_mutex);
        active_readers--;
        // 마지막 Reader 스레드가 크리티컬 섹션을 빠져나오는 경우(active_readers == 0), 
        // mutex 뮤텍스의 락을 푸어 다른 스레드들이 크리티컬 섹션에 진입할 수 있도록 함
        if (active_readers == 0)
            pthread_mutex_unlock(&mutex);
        // reader_mutex 뮤텍스의 락을 푸어 크리티컬 섹션을 완전히 벗어남
        pthread_mutex_unlock(&reader_mutex);

    }
    pthread_exit(NULL);
}

/*
 * Writer 스레드는 어떤 사람의 얼굴 이미지를 출력한다.
 * 이미지는 여러 종류가 있으며 인자를 통해 식별한다.
 * Writer가 critical section에 있으면 다른 writer는 물론이고 어떠한 reader도 들어올 수 없다.
 * 만일 이것을 어기고 다른 writer나 reader가 들어왔다면 얼굴 이미지가 깨져서 쉽게 감지된다.
 */
void *writer(void *arg)
{
    int id, i;
    struct timespec req;

    /*
     * 들어온 인자를 통해 얼굴 이미지의 종류를 정한다.
     * 랜덤 생성기의 시드 값을 현재 시간으로 초기화한다.
     */
    id = *(int *)arg;
    srand(time(NULL));
    /*
     * 스레드가 살아 있는 동안 같은 이미지를 반복해서 출력한다.
     */
    while (alive) {
        // write 뮤텍스를 락을 걸어 Writer 스레드가 크리티컬 섹션에 진입할 때,
        // 다른 스레드가 크리티컬 섹션에 동시에 진입하지 못하도록 함
        pthread_mutex_lock(&writer_mutex);
        //처음으로 Writer 스레드가 크리티컬 섹션에 진입하는 경우(active_writers == 0), 
        // queue 뮤텍스를 락을 걸어 다른 스레드들이 크리티컬 섹션에 진입하지 못하도록 함
        if (active_writers == 0)
          pthread_mutex_lock(&queue_mutex);
        // active_writers 값을 증가시키고, writer 뮤텍스의 락을 푸어 크리티컬 섹션에 진입
        active_writers++;
        pthread_mutex_unlock(&writer_mutex);
        // mutex 뮤텍스를 락을 걸어 Writer 스레드가 크리티컬 섹션에 진입할 때 
        // 다른 스레드들이 크리티컬 섹션에 진입하지 못하도록 함
        pthread_mutex_lock(&mutex);
        /*
         * Begin Critical Section
         */
        printf("\n");
        switch (id) {
            case 0:
                for (i = 0; i < L1; ++i)
                    printf("%s\n", img1[i]);
                break;
            case 1:
                for (i = 0; i < L2; ++i)
                    printf("%s\n", img2[i]);
                break;
            case 2:
                for (i = 0; i < L3; ++i)
                    printf("%s\n", img3[i]);
                break;
            case 3:
                for (i = 0; i < L4; ++i)
                    printf("%s\n", img4[i]);
                break;
            case 4:
                for (i = 0; i < L5; ++i)
                    printf("%s\n", img5[i]);
                break;
            default:
                ;
        }
        /* 
         * End Critical Section
         */
        // 크리티컬 섹션을 나와서 mutex 뮤텍스의 락을 푸고 Writer 스레드가 크리티컬 섹션을 완전히 벗어남
        pthread_mutex_unlock(&mutex);
        // writer 뮤텍스를 락을 걸고, active_writers 값을 감소
        pthread_mutex_lock(&writer_mutex);
        active_writers--;
        // 마지막 Writer 스레드가 크리티컬 섹션을 빠져나오는 경우(active_writers == 0), 
        // queue 뮤텍스의 락을 푸어 다른 스레드들이 크리티컬 섹션에 진입할 수 있도록 함
        if (active_writers == 0)
          pthread_mutex_unlock(&queue_mutex);
        // write 뮤텍스의 락을 푸어 크리티컬 섹션을 완전히 벗어남
        pthread_mutex_unlock(&writer_mutex);
        /*
         * 이미지 출력 후 SLEEPTIME 나노초 안에서 랜덤하게 쉰다.
         */

        req.tv_sec = 0;
        req.tv_nsec = rand() % SLEEPTIME;
        nanosleep(&req, NULL);
    }
    pthread_exit(NULL);
}

/*
 * 메인 함수는 NREAD 개의 reader 스레드를 생성하고, NWRITE 개의 writer 스레드를 생성한다.
 * 생성된 스레드가 일을 할 동안 0.2초 동안 기다렸다가 alive의 값을 0으로 바꿔서 모든 스레드가
 * 무한 루프를 빠져나올 수 있게 만든 후, 스레드가 자연스럽게 종료할 때까지 기다리고 메인을 종료한다.
 */
int main(void)
{
    int i;
    int rarg[NREAD], warg[NWRITE];
    pthread_t rthid[NREAD];
    pthread_t wthid[NWRITE];
    struct timespec req;
    // 조건 변수와 뮤텍스 락 초기화
    pthread_mutex_init(&mutex, NULL);
    pthread_mutex_init(&writer_mutex, NULL);
    pthread_mutex_init(&reader_mutex, NULL);
    pthread_mutex_init(&queue_mutex, NULL);
    /*
     * Create NREAD reader threads
     */
    for (i = 0; i < NREAD; ++i) {
        rarg[i] = i;
        if (pthread_create(rthid+i, NULL, reader, rarg+i) != 0) {
            fprintf(stderr, "pthread_create error\n");
            return -1;
        }
    }
    /* 
     * Create NWRITE writer threads
     */
    for (i = 0; i < NWRITE; ++i) {
        warg[i] = i;
        if (pthread_create(wthid+i, NULL, writer, warg+i) != 0) {
            fprintf(stderr, "pthread_create error\n");
            return -1;
        }
    }
    /* 
     * Wait for RUNTIME nanoseconds while the threads are working
     */
    req.tv_sec = 0;
    req.tv_nsec = RUNTIME;
    nanosleep(&req, NULL);
    /*
     * Now terminate all threads and leave
     */
    alive = false;
    for (i = 0; i < NREAD; ++i)
        pthread_join(rthid[i], NULL);
    for (i = 0; i < NWRITE; ++i)
        pthread_join(wthid[i], NULL);

    // 조건 변수와 뮤텍스 락 destroy
    pthread_mutex_destroy(&mutex);
    pthread_mutex_destroy(&writer_mutex);
    pthread_mutex_destroy(&reader_mutex);
    pthread_mutex_destroy(&queue_mutex);

    return 0;
}
